const Header = () => {
    return (
        <header>
            <h1>Blog App</h1>
            <nav>
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/login">Login</a></li>
                    <li><a href="/register">Register</a></li>
                    <li><a href="/create-post">Create Post</a></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
